      <img
        className="inline-block object-cover w-full h-full "
        src={item.imagePath}
      ></img>
      <div className="absolute   border-gray-500 border-2  w-full bg-slate-400 truncate">
        {item.description}
      </div>
    </div>
  );
};

export default Main_Item;
